                    $(this).attr("aria-expanded", "true");
                    $("#gb-schools-panel-outer").attr("aria-hidden", "false").slideDown(function() {
                        $("#gb-school-list-headers .gb-school-list-header").first().focus();
                    });
                } 
            });

