                        if(!$("#hp-slideshow .mmg-description .mmg-description-inner").length) {
                            $("#hp-slideshow .mmg-description").wrapInner("
");
                        }
                        var numOfImages = $("#hp-slideshow .mmg-control-counter span").last().text();

                        var imageIndex = $("#hp-slideshow .mmg-slide.active").data("record-index");


                        if($("#hp-slideshow .mmg-control-counter.back").length) {
                        	if(imageIndex == 0) {
                            	$("#hp-slideshow .active-image-counter").text(numOfImages);
                            } else {
                        		$("#hp-slideshow .active-image-counter").text(imageIndex);
                            }
                        	$("#hp-slideshow .mmg-control-counter").removeClass("back");
                        } else {
                            imageIndex = imageIndex + 2;
                            if(imageIndex > numOfImages) {
                                $("#hp-slideshow .active-image-counter").text("1");
                            } else {
                                $("#hp-slideshow .active-image-counter").text(imageIndex);
                            }
                        }
                    }, // props.element, props.currentRecordIndex, props.currentGalleryIndex, props.nextRecordIndex, props.nextGalleryIndex, props.mmgRecords
                    "onTransitionEnd" : function(props) {
                        if(!$(".mmg-description .mmg-description-inner",props.element).length) {
                            $(".mmg-description",props.element).wrapInner("
");
                        }
                    }, // props.element, props.currentRecordIndex, props.currentGalleryIndex, props.mmgRecords
