        "AllyClick": function(event) {
            if(event.type == "click") {
                return true;
            } else if(event.type == "keydown" && (event.keyCode == this.KeyCodes.space || event.keyCode == this.KeyCodes.enter)) {
                return true;
            } else {
                return false;
            }
        },

        "handleTabListKey": function(tab, tabClass, event) {
        	var lastIndex = $(tabClass).length - 1;
            var _this = this;

            switch(event.keyCode){
                // CONSUME LEFT AND UP ARROWS
                case _this.KeyCodes.left:
                case _this.KeyCodes.up:
                    event.preventDefault();

                    // FOCUS THE PREVIOUS TAB
                    if (tab.index() == 0) { 
                        $(tabClass + ":last-child").focus();
                    } else { 
                        $(tabClass).eq(tab.index() - 1).focus();
                    } 
                break;

                // CONSUME RIGHT AND DOWN ARROWS
                case _this.KeyCodes.right:
                case _this.KeyCodes.down:
                    event.preventDefault();

                    // FOCUS THE NEXT TAB
                    if (tab.index() == lastIndex) { 
                        $(tabClass + ":first-child").focus();
                    } else { 
                        $(tabClass).eq(tab.index() + 1).focus();
                    }
                break;

                // CONSUME HOME KEY
                case _this.KeyCodes.home:
                    event.preventDefault();

                    // FOCUS THE FIRST TAB
                    $(tabClass + ":first-child").focus();
                break;

                // CONSUME END KEY
                case _this.KeyCodes.end:
                    event.preventDefault();

                    // FOCUS THE LAST TAB
                    $(tabClass + ":last-child").focus();
                break;
            }
        },

